import React from 'react';

const Button = ({ text, color, onClick }) => (
  <button
    onClick={onClick}
    style={{
      margin: '5px',
      padding: '10px 20px',
      backgroundColor: color,
      color: '#fff',
      border: 'none',
      borderRadius: '4px',
      cursor: 'pointer',
    }}
  >
    {text}
  </button>
);

export default Button;
